import React from "react";
import "./App.css";

function App() {
  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        position: "relative",
        backgroundImage:
          "url(https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm428-0019-x.jpg?w=800&dpr=1&fit=default&crop=default&q=65&vib=3&con=3&usm=15&bg=F4F4F3&ixlib=js-2.2.1&s=16c4ed18afc4ccfb86f468a829d23a1d)",
      }}
    >
      <div
        style={{
          width: 1232,
          height: 114,
          left: 23,
          top: 34,
          position: "absolute",
          background: "white",
          borderRadius: 20,
          border: "1px black solid",
        }}
      ></div>
      <div
        style={{
          width: 1287,
          height: 66,
          left: 63,
          top: 63,
          position: "absolute",
        }}
      >
        <div
          style={{
            width: 447,
            height: 37,
            left: 840,
            top: 12,
            position: "absolute",
            color: "black",
            fontSize: 30,
            fontFamily: "Lusitana",
            fontWeight: "400",
            wordWrap: "break-word",
          }}
        >
          Monday, October 2, 2023
        </div>
        <div
          style={{
            width: 269,
            height: 39,
            left: 97,
            top: 14,
            position: "absolute",
            color: "black",
            fontSize: 30,
            fontFamily: "Lusitana",
            fontWeight: "400",
            wordWrap: "break-word",
          }}
        >
          78* F, Mostly Sunny
        </div>
        <div
          style={{
            width: 66,
            height: 66,
            left: 0,
            top: 0,
            position: "absolute",
            background: "#FEF40A",
            borderRadius: 9999,
          }}
        />
      </div>
    </div>
  );
}

export default App;
